pragma solidity 0.8.11;







interface ISuperDeedV1 {
   
    function getClaimable(uint id) external view returns (bool valid, uint amount, uint indexFrom, uint indexTo, uint claimedSofar, uint totalEntitlement);
}

interface ISuperDeedV25 {

    struct GroupInfo {
        string name;
        uint totalEntitlement;
    }
    
    struct NftInfo {
        uint groupId;
        uint totalEntitlement; 
        uint totalClaimed;
        bool valid;
    }  

    function getGroupInfo(uint groupId) external view returns (GroupInfo memory);
    function getNftInfo(uint nftId) external view returns (NftInfo memory);
    function setUserSourceByCampaign(uint groupId, string memory groupName, uint totalTokens,  bool finalizeGroup) external ;
    function claimDeedFromCampaign(address user, uint groupId, string memory groupName, uint amount) external ;
    function getClaimable(uint nftId) external view returns (uint claimable, uint totalClaimed, uint totalEntitlement);
}


contract BthMigration is ERC721Holder, ReentrancyGuard, Pausable, Ownable {

    
    // Note: SDV1's totalEntitlement is 95% of initial total Entitlement. This value is correct.
    // SDV1 has also released 1.25%, which translate to 1.31578% (based on SDV1's totalEntitlement). // 1.25%/0.95 = 1.31578947%
    // So the new SDV2 totalEntitlement (after deducting for 10% dao fee) should be (100% - 1.31578%)*90% = 88.815%
    
    uint private constant DEDUCTION_FACTOR = 888157894736842105 ; // 88.815%
    uint private constant FACTOR = 1e18;
   

    address public daoMultiSig;
    address public oldSuperDeed;
    address public newSuperDeed;
    uint    public groupId;
    string  public groupName;
    uint    public totalEntitlement;
    bool    public setupOk;

    // For record & Query
    mapping(uint=> address) public idMap;
    mapping(address=>uint[]) public userMap;

    event Setup(uint groupId, uint totalEnt);
    event UserMigrate(address indexed user, uint nftId, uint entitlement);
   

    modifier onlyDAO() {
        require(msg.sender == daoMultiSig, "Not Dao MultiSig");
        _;
    }

    constructor (address dao) {
        require(dao != address(0), "Invalid address");
        daoMultiSig = dao;
    }

    function setup(address oldDeed, address newDeed, uint grpId, string memory grpName, uint oldEntitlement) external onlyOwner {

        require(oldDeed != address(0) && newDeed != address(0), "Invalid address");
        require(!setupOk, "Already setup");

        setupOk = true;
        oldSuperDeed = oldDeed;
        newSuperDeed = newDeed;
        groupId = grpId;
        groupName = grpName;

        // The total entitlement should be 88.875% of totalEntitlement in the pre-migrated SuperDeed V1
        require(oldEntitlement > 0, "Invalid entitlement");
        totalEntitlement = (oldEntitlement * DEDUCTION_FACTOR) / FACTOR;

        // Setup the new Deed
        ISuperDeedV25 iDeed = ISuperDeedV25(newSuperDeed);
        iDeed.setUserSourceByCampaign(groupId, groupName, totalEntitlement, true);
  
        emit Setup(groupId, totalEntitlement);
    }

    function hasUnclaimedTokens(uint nftId) public view returns (bool) {
      
        ISuperDeedV1 oldDeed = ISuperDeedV1(oldSuperDeed);
        (bool valid, uint amount, , , , ) = oldDeed.getClaimable(nftId);
        return (valid && amount > 0);
    }

    function doMigrate(uint nftId) external whenNotPaused nonReentrant {

        // Make sure the old deed has claimed before migrating
        ISuperDeedV1 oldDeed = ISuperDeedV1(oldSuperDeed);
        (bool valid, uint amount, , , , uint totalEnt) = oldDeed.getClaimable(nftId);
        require(totalEnt>0, "Invalid entitlement");
        require(valid && amount == 0, "Claim tokens first");

        // Transfer the old SuperDeed into the contract
        IERC721(oldSuperDeed).safeTransferFrom(msg.sender, address(this), nftId);

        // Claim new Deed
        // Note: the new SuperDeed will have 88.875% of pre-migrated superdeed entitlement.
        // This is after deducting for 1.25% claimed and 10% dao fee.
        ISuperDeedV25 newDeed = ISuperDeedV25(newSuperDeed);
        uint entitlement = (totalEnt * DEDUCTION_FACTOR) / FACTOR;
        newDeed.claimDeedFromCampaign(msg.sender, groupId, groupName, entitlement);
  
        // Record
        idMap[nftId] = msg.sender;
        userMap[msg.sender].push(nftId);

        emit UserMigrate(msg.sender, nftId, entitlement);
    }

    function setPause(bool pause) external onlyDAO {
        if (pause) {
            _pause();
        } else {
            _unpause();
        }
    }
}
